const combinations = `
function permu(str){
  let currentNum=[];
  let remainingNum=[];
  let result=[];

  let i,j;
  if(str.length===0) return "";
  if(str.length===1) return str;

  for(i=0; i<str.length; i++){
    currentNum = str[i];
    remainingNum = str.slice(0,i) + str.slice(i+1);

    for(j=0; j<remainingNum.length; j++){
      result.push(currentNum+permu(remainingNum)[j]);
    }
  }
  return result;
}

console.log(permu('abc'));
`.trim();

const isIsomorphic = `
function longStr() {
  const str1 = 'egg';
  const str2 = 'add';

  const isIsomorphic = (str1 = '', str2 = '') => {
  if (str1.length !== str2.length) {
      return false;
  };
  for (let i = 0; i< str1.length; i++) {
      const a=str1.indexOf(str1[i]);
      const b=str2.indexOf(str2[i]);
      if (str2[a] !== str2[i] || str1[b] !== str1[i]) {
          return false;
      };
  };
  return true;
  };
  console.log(isIsomorphic(str1, str2));
}

longStr()
`.trim();

const wordBreak = `
function wordBreak(s, wordDict) {
  const dp = new Array(s.length + 1).fill(false);
  dp[0] = true;

  for (let i = 1; i <= s.length; i++) {
    for (let j = 0; j < i; j++) {
      if (dp[j] && wordDict.includes(s.substring(j, i))) {
        dp[i] = true;
        break;
      }
    }
  }

  return dp[s.length];
}

console.log(wordBreak("leetcode", (wordDict = ["leet", "code"])));
`.trim();

const removeDuplicates = `
function removeDup() {
  const str = "wwelcom";
  let stack = [];
  for (let i = 0; i < str.length; i++) {
    if (str[i] === stack[stack.length - 1]) {
      stack.pop();
    } else {
      stack.push(str[i]);
    }
  }
  return console.log(stack.join(""));
}

removeDup();
`.trim();

const lonStr = `
function lonStr(){
