              <div style={titles}>
                <PrismCode
                  code={findVowel}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>5. Palindrom</h3>
              <div style={titles}>
                <PrismCode
                  code={Palindrom}
                  language="js"
                  plugins={["line-numbers"]}
                />
              </div>
              <br />
              <h3>6. Palindrome Number.</h3>
              Determine whether an integer is a palindrome. An integer is a
              palindrome when it reads the same backward as forward.
              <br /> <br />
              Input: 121
              <div style={titles}>
                <PrismCode
                  code={isPalindromes}
                  language="js"
                  plugins={["line-numbers"]}
